import React from 'react';
import "../rightbar.css"
function Leftbar() {
  return <div className='rightbar'>
      <div>
          <h1>Ankush</h1>
          <div className='card-pic'> 
          <img src="https://i.pinimg.com/564x/4a/71/1e/4a711ee02922b97a39d9c1e56a3189f2--black-card-credit-cards.jpg"/>
          </div>
          <div className='current balance'>

          </div>
      </div>
  </div>;
}

export default Leftbar;
